const SeminarCard = ({ seminar, onEdit, onDelete }) => {
  return (
    <div className="seminar-list__item" key={seminar.id}>
      <img
        className="seminar-list__img"
        src={imageUrl}
        alt={seminar.title}
        style={{ width: "100%", borderRadius: "10px" }}
      />
      <h3>{seminar.title}</h3>
      <p>{seminar.description}</p>
      <h4>
        {seminar.date} / {seminar.time}
      </h4>
      <div className="seminar-list__btns">
        <button onClick={() => openModal(seminar)}> Редактировать</button>
        <button onClick={() => deleteSeminar(seminar.id)}>Удалить</button>
      </div>
    </div>
  );
};

export default SeminarCard;
